import axios from 'axios';
import React from 'react'
import { useState, useEffect } from 'react';

export default function getData() {
    const [post, setPost] = useState([]);
    useEffect(()=>{
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then(res => {
            console.log(res);
            setPost(res.data);
        })
        .catch(err =>{
            console.log(err);
        })
    })
    return (
        <div>
        <ul>
            {
                post.map(ele=>{
                    <li key ={ele.id}>
                        {ele.title}
                    </li>
                })
            }   
        </ul>
        </div>
    )
}
